- input: "TEXT\x1CC00044842\x1C.TEXT\x1C\x1CF3XN\x1CPayments for Net Salary were made
    for staff members spending less than 25% of their time on federal election activity
    or any activities in connection with a federal election.  The receipt from CobraServ
    National Service is a refund for COBRA Coverage paid by the individual covering
    the costs incurred by the Committee from Capital Blue Cross.  The payment to Capital
    Blue Cross was made July 29 and appears in Schedule B supporting Line 21(b) .
    \ Schedule B supporting Line 21(b) payment to CD Inc was for generic party fundraising
    online for the state party federal account.  The state party does not fund-raise
    for specific candidates.  In Schedule B supporting Line 21(b) payment to Greenlee
    Partners LLC is reimbursement for healthcare provided for an employee leaving
    there to work with the state party until the employee was covered under the state
    party. Nick Sinatra was hired to do generic party fundraising for the state party
    federal account, no specific candidate.  Payment to Spalding Group on Line 21(b)
    was for the purchase of Yard Signs, Bumper Stickers and Placards.  Receipts on
    Line 15 are payment for yard signs provided to the County Parties purchased by
    the Republican Federal Committee of Pa from the Spalding Group. "
